import React from 'react'
import Header from './Header'
import UserInfo from './UserInfo'
import '../App.css';

const user = [
  {
    name: "Tal",
    age: 23,
    gender: "Male"
  },
  {
    name: "Miri",
    age: 31,
    gender: "Female"
  },
  {
    name: "Nadia",
    age: 27,
    gender: "Female"
  },
  {
    name: "Igal",
    age: 24,
    gender: "Male"
  }
]


function App() {
  return (
    <div className="App">
      <Header />
      <UserInfo />
    </div>
  );
}

export default App;
